(1, 'John', 'Sean', 5, 'Swimming', 'With my 5 years experience in the field of swimming, I know that this activity helps people with back pain, muscle fatigue to feel well after 1 month of practice. You can discover more about my advices on my Youtube channel. Welcome to Your Wellbeing.', 'john.sean@gmail.com', NULL),
(2, 'Tina', 'Doug', 2, 'Biking', 'I have been biking for a long time as a hobby and I got my professional license 2 years ago. Fitness biking is a complete exercise I recommend to any customer at any age and it is efficient in recoverying the whole body wellbeing in a short time. You will burn calories and lose body fat as well. I like coaching this exercise and I invite you to watch my facebook profile to learn more this fitness.', 'christoph.doug@yahoo.fr', NULL),
(3, 'Alexander', 'Vincent', 7, 'Yogga', 'Yogga is relaxing fitness activity practised since centuries in some part of world. It is known to be suitable to have the body and soul tranquility and for this reason, it is recommended for anybody no matter the age.', 'alexander.vincent@hotmail.com', NULL),
(4, 'Salma', 'Erikson', 5, 'Bodybuilding', 'Bodybuilding helps in dissipating most of the harmful calories and fat from the body. It gives strength and tonicity to muscles and helps is reducing the body fatigue. This activity can be practised in centers as well as at home at the learner\'s convenience. Many videos are available on my profile to guide you.', 'zizou.erikson@gmail.com', NULL);

