INSERT INTO `products` (`id`, `product_code`, `product_name`, `product_desc`, `product_img_name`, `qty`, `price`) VALUES
(1, 'product101', 'Optimum Nutrition Gold Standard Whey Protein', 'Optimum Nutrition\'s Gold Standard 100% Whey uses pure Whey Protein Isolates as the primary ingredient. Combined with ultra-filtered whey protein concentrate, each serving provides 24 grams of all-whey protein and 5.5 grams of naturally occurring Branched Chain Amino Acids (BCAAs) which are prized by athletes for their muscle building qualities. With more than 20 tempting flavors to choose from, ONs Gold Standard 100% Whey gives you plenty of ways to keep workout recovery interesting.', 'on.jpg', 20, '60.00'),
(2, 'product102', 'MuscleTech Nitro-Tech Whey Protein', 'NITRO-TECH is a scientifically engineered whey protein formula, and is enhanced with the most studied form of creatine for even better gains in muscle and strength. It also features whey protein, which is the most popular type of protein. Whey protein is made up of branched chain amino acids (BCAAs) and essential amino acids (EAAs), and has the highest biological value (the measure of how well your body absorbs and assimilates protein). The whey protein in NITRO-TECH is sourced primarily from whey peptides and whey isolate  two of the cleanest and purest protein sources available.', 'nitro.jpg', 0, '50.00'),
(3, 'product103', 'Renpho 300lb Body Weight Scale with BMI Technology', 'RENPHO body fat scale utilizes Bio-electrical Impedance Analysis(BIA) to calculate 13 key body composition metrics.\r\nIt can give you an overview of your body and track your daily, weekly, and monthly progress.', 'scale.jpg', 23, '55.00'),
(4, 'product104', 'Fitbit Sense Advanced Smartwatch', 'Meet Fitbit Sensethe advanced health smartwatch that helps you tune in to your body and guides you toward better health. Assess your heart for AFib right from your wrist, detect and manage stress, better understand your sleep quality and even keep an eye on patterns in your skin temperature or well-being with SpO2. Plus, Sense unlocks a 6-month free trial of personalized guidance and advanced insights for new Fitbit Premium users.', 'fitbit.jpg', 20, '385.00'),
(5, 'product105', 'Etekcity Bathroom Body Weight Scale', 'Sleek and Sturdy design that will go well with any bathroom tile Built with a sturdy form to deliver a long service lifetime while still maintaining a slim and modern look to accent your home or personal gym. The sleek tempered glass platform ensures safety through support while displaying a subtle sophistication in modern design. Big Convenience, Smart Measurement With the \'Step-On\' technology, just step on the scale and get readings in a few seconds.', 'scale2.jpg', 10, '30.00'),
(6, 'product106', 'Blackview Smart Watch R3 pro max ', '?24/7 Heart Rate Monitor & Sleep Tracker? Blackview R3 Pro Smart watch can automatically monitor your real-time heart rate,and better understand your heart rate trends.You also can get a better understanding of your sleep quality with comprehensive sleep quality tracking,(deep sleep,light sleep and wake up time) helping you adjust yourself for a healthier lifestyle.', 'blue.jpg', 25, '205.00');

